import React from 'react';


import classes from './App.module.css';
import ProductData from "./ProductData";

import amazon from './img/amazon.jpg';
import watch1 from './img/watch1.png';
import redWatch from './img/redWatch.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav className={classes.Topbar}>
        <img src={amazon} alt="Amazon Logo" />
        </nav>
      </header>

    <div className={classes.MainContainer}>
        <div className={classes.ProductPreview}>
        <img src={watch1} alt="Black Strap" />
        </div>

        <div className={classes.ProductData}>
        <h1 className={classes.ProductTitle}> {ProductData.title} </h1>
        <p className={classes.ProductDescription} > {ProductData.description} </p>
        <h3 className={classes.SectionHeading}> Select Color </h3>
        <div>
          <img className={classes.ProductImage} src={redWatch} alt="Red Strap"/>
          <img className={classes.ProductImage} src="" alt="Purple Strap"/>
        </div>
        </div>
    </div>


    </div>
  );
}

export default App;
